import React from "react";
import Char from "./Char";
import "./styles/info.css";

export default function Info() {
  return (
    <section className="game">
      <div className="game__info">
        <img
          className="game__info-look"
          src="images/games/monopoly.png"
          alt="Картинка не загружена"
        />
        <div className="game__info__data">
          <h2>Монополия</h2>
          <Char />
          <div className="game__info-desc">
            <div className="game__info-desc-buy">
              <p>129</p>
              <button className="oneClick">В один клик</button>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
